import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import styles from './ClothingCatalog.module.css';

const clothingItems = [
  { id: 1, name: 'Coat', image: '/assets/images/coat.png' },
  { id: 2, name: 'Warm puffer', image: '/assets/images/warm-puffer.png' },
  { id: 3, name: 'Bomber', image: '/assets/images/bomber.png' },
  { id: 4, name: 'Biker jacket', image: '/assets/images/biker-jacket.png' },
  { id: 5, name: 'Denim jacket', image: '/assets/images/denim-jacket.png' },
  { id: 6, name: 'Blazer (suit)', image: '/assets/images/blazer.png' },
  { id: 7, name: 'Printed/checked', image: '/assets/images/printed-checked.png' },
  { id: 8, name: 'Basic tees', image: '/assets/images/basic-tees.png' },
  { id: 9, name: 'Baseball tee', image: '/assets/images/baseball-tee.png' },
  { id: 10, name: 'Crew neck sweat', image: '/assets/images/crew-neck-sweat.png' }
];

export default function ClothingCatalog() {
  const navigate = useNavigate();
  const [searchQuery, setSearchQuery] = useState('');

  const handleClose = () => {
    navigate(-1);
  };

  const filteredItems = clothingItems.filter(item =>
    item.name.toLowerCase().includes(searchQuery.toLowerCase())
  );

  return (
    <div className={styles.container}>
      <h1 className={styles.title}>Clothing Catalog</h1>
      
      <div className={styles.searchContainer}>
        <input
          type="text"
          placeholder="Search for clothing items..."
          className={styles.searchInput}
          value={searchQuery}
          onChange={(e) => setSearchQuery(e.target.value)}
        />
      </div>

      <div className={styles.grid}>
        {filteredItems.map((item) => (
          <div key={item.id} className={styles.card}>
            <div className={styles.imageContainer}>
              <img src={item.image} alt={item.name} className={styles.itemImage} />
            </div>
            <div className={styles.itemName}>{item.name}</div>
          </div>
        ))}
      </div>
    </div>
  );
}
